@SSDifnskdjfnsdjk: na XP 32 bit se ani nic moc neda zlepsovat. Ale na XP 64 bit to bylo hned jine. Taky se dalo hodne z Win 7 64 bit integrovat. Napriklad ovladace ke kterym patri i ta systemova a aplikacni kryptografie. Ale ja bohuzel to 64 bit ISO nemam, na kterou by se vztahoval muj XP Pro 32 klic. Presne tak jak se vztahuje i muj 7 32 bit Ultimate klic na 64 bit. Ja jsem uz jenom zvedav jak se povede projektu ReactOS 64 bit, zatim je stale jen 32 bit a tim padem se do 64 bit sveta moc nedostane. ReactOS je ale zajimavy pro veskere herni prostredi jedouci na 32 bitech a to za maximalniho systemoveho bezpeci bez MS der. Teho casu splnuje ReactOS temez cele Windows 2003 Server prostredi a da se s tim pracovat i jako by to bylo pouze prostredi 7 a nebo XP. Clovek sice muze pouzit i MS prostredku ale riskuje ze do ReactOS zanese MS diry, ktere by v nem nemel. Co se tyce Windows od MS doporucuji jedine 7 a nic jineho a nejradej vubec zadny MS. Co se tyce Linuxu tak jsem doporucoval do nedavna jedine dve distribuce a zadne jine, bud GNU/Debian atd, a nebo Gentoo, podle toho zda-li mel clovek cas na Gentoo udrzovani ktere je velmi a hlavne casove narocne, ale clovek muze mit naprosto perfektne odladene prostredi, co u Debinana a spol tezko ma. Pro pohodlne je dobra Ubuntu vetev, ale zalezi na panech techto distribuci, jak driv treba byla dobra SuSE ale tak maximalne do 7.3, tak po prevzeti projektu bida a utrpeni. Dnes, kdyz je bezpeci tak dulezite pripadaji pro narocne jen dve volby. 

